            "created": 1442950567000, 
            "description": "<p>We're a group of women who want to learn and develop our Python scripting skills. Some of us are professional developers and data scientists, others are hobbyists, and some are just beginning. The study group is intended for everyone who wishes to learn more about the Python programming language. Folks of all skill levels are welcome!</p> <p><br/>We host beginners night on the first Wednesday of every month, which caters especially for absolute beginners and people with basic familiarity.</p> <p>All other study group nights will generally cover more advanced topics and work on projects more in depth, according to everyone's interests.</p> <p>(Please bring a laptop!)</p> <p><br/>Here are the slides from Julia</p> <p><a href=\"http://slides.com/juliapoladsky/intro-to-git/live#/5/1\"><a href=\"http://slides.com/juliapoladsky/intro-to-git/live#/5/1\" class=\"linkified\">http://slides.com/juliapoladsky/intro-to-git/live#/5/1</a></a></p> <p><br/>There will be food at this event!</p> <p>Julia Poladsky will be presenting Introduction to GitHub at the Iron Yard.\u00a0</p> <p><br/>This Women Who Code DC event is intended to be exclusively open for women; we are trans* friendly.</p>", 
