            "created": 1443214684000, 
            "description": "<p>Seven teams of DC data scientists have come together for a three month incubator to turn theory into practice on projects spanning health, economics, the environment, and more. Learn from their experience deploying a financial model as an interactive web app on Heroku, displaying rare mineral data using Shiny, and correlating Starbucks locations with business opportunities across time(series) and space(ial analytics)... plus much more! Enjoy brunch on us as we are taken from concept to production on eight data products, and then join the judges by voting for the winner!\u00a0</p> <p>\n\n<b>Agenda:</b></p> <p>11:00 am\u00a0-- Brunch and mingling</p> <p>11:30 am\u00a0-- Presentations!</p> <p>1:00pm\u00a0-- Go out for post-event mimosas at Tonic!</p> <p>\n\n\n<b>About our teams:</b></p> <p><br/><i>In partnership with the Department of Labor:</i></p> <p><b>The Redline -\u00a0</b>(Felicia, Wat, Ian, Wayne) is using OSHA data to operationalize their data related to workplace injuries.</p> <p><br/><b>Data Bandits -\u00a0</b>(Sasan, Dilip, Ed, Hari) is providing a way to use your personal spending habits to generate a personal Consumer Price Index.</p> <p><br/><b>CanIMakeIt -\u00a0</b>(Mason, Nathan, Max) is providing housing recommendations and predicting economic success based on various financial factors in different DC neighborhoods.</p> <p>\n\n<i>In partnership with the U. S. Geological Survey:</i></p> <p><br/><b>Mineralytics -\u00a0</b>(Johanna, Qi, Tridib, Adam) is using USGS data to contrast worldwide rare mineral consumption rate and consumer electronics production.</p> <p>\n\n<i>In partnership with the Department of Commerce:</i></p> <p><br/><b>Gentrifuge -\u00a0</b>(Saran, Thomas, David, Karpura) is building a model that predicts gentrification in a geographical area.</p> <p><br/><b>EMU -\u00a0</b>(Sudhir, Erich, Erica, Harish) is utilizing Census financial data and Starbucks location points to predict a market's ripeness for big-box retailers.</p> <p><br/><b>The Censusables -\u00a0</b>(Alexis, Russel, Abishek, Jim) is investigating Census and Yelp data to identify diffrent types of business activity by geographical area.</p>", 
