            "created": 1443151352000, 
            "description": "<p>Meteorology is a field that has always used massive amounts of data and statistical analysis in trying to predict future outcomes. The techniques used were data science before data science even existed. But Data Science MD has not yet had a meteorology speaker. That all changes this October. Come out and see what is sure to be an electric presentation.</p> <p>Agenda</p> <p>6:30 PM -- Networking &amp; Food\u00a0</p> <p>6:55 PM -- Greetings &amp; Prizes</p> <p>7:00 PM -- Data Science: A Climate Modeler\u2019s Perspective</p> <p>9:00 PM -- Post event drinks at\u00a0<a href=\"http://www.ofloveandregret.com/\">Of Love &amp; Regret</a></p> <p>Location</p> <p>Join us at the new home of Ad.com!\u00a0</p> <p>3700 O'Donnell Street</p> <p>Baltimore, MD \u00a021224</p> <p>Parking</p> <p>Park in any open street spots as well as the triangle lot that is outlined in purple. Do not park in spots marked handicap, no parking, or for specific companies. The X marks the spot of the meetup. We are directly behind the Natty Boh tower on the campus (the building with the big white roof).\u00a0</p> <p><img src=\"http://photos3.meetupstatic.com/photos/event/9/b/5/7/600_435819767.jpeg\" /></p> <p>Talks</p> <p>Data Science: A Climate Modeler\u2019s Perspective</p> <p>Climate Change is arguably the most important global issue of our times. Multiple scholarly analyses of the historical record have shown how the climate is already changing and impacting virtually almost all parts of our blue planet, whereas massively parallel General Circulation Model simulations paint a vivid picture of what lies ahead in the coming decades through the end of the century. These simulations derive their basis from various disciplines including physics, chemistry, ecology, statistics, engineering, and even economics. Data Science is the invisible thread that connects these interdisciplinary strands into a unified model. The objective of this presentation is to provide a brief overview of the methods, both statistical and dynamical, used in the speaker's specialization of high-resolution climate simulations. It concludes with a case study drawn from the speaker's recent research.</p> <p>Speaker</p> <p><a href=\"https://www.linkedin.com/in/pracherla9\">Pavan Racherla</a>\u00a0has a Ph.D. in Engineering &amp; Public Policy from Carnegie Mellon University (2007), wherein his thesis was on \u201cThe Sensitivity of Ozone and Particulate Matter Concentrations to Climate Change at Various Spatiotemporal Scales.\u201d He worked thereafter as a Postdoctoral and Associate Research Scientist at NASA Goddard Institute for Space Studies [masked]). He is currently \u00a0Principal Researcher at a nonprofit organization called NextClimate. His research has been highlighted in prestigious academic journals like Science as well as popular media outlets like Discovery News.</p> <p><br/>Post Event Drinks</p> <p><a href=\"http://www.ofloveandregret.com/\">Of Love &amp; Regret</a></p> <p>1028 South Conkling Street, Baltimore\u00a0</p>", 
