            "created": 1441299586000, 
            "description": "<p><b>Introduction to UX:\u00a0</b></p> <p><br/>At its core, User Experience (UX) is defined as how someone feels about using a product, system, or service. Regardless of what we\u2019re designing -- a website, an Android app, or a toaster--we all strive to make our designs useful, easy to use, and enjoyable to use. But how exactly do we make something useful, easy to use, and enjoyable? How do we know if the target audience is having a good or bad experience? This class will arm you with the essential tips to find those answers.</p> <p>\n\n\n<b>About the Instructor:\u00a0</b></p> <p><img src=\"http://photos2.meetupstatic.com/photos/event/d/5/a/9/600_441594697.jpeg\" /></p> <p>Jenny is a UX designer with background in UI design, web development, and painting.\u00a0</p> <p>Fascinated with Human-Computer Interaction, how it affects our daily lives, and how interacting with, and building, technology could improve our lives; Jenny's\u00a0passion is\u00a0making software usable, and bridging the gap between clients and users with developers and technology.</p> <p>Jenny is currently consulting\u00a0with agencies, startups and small businesses on awesome digital projects. She\u00a0also writes about UX at\u00a0<a href=\"http://www.uxjenny.com/\">www.uxjenny.com</a>.</p> <p><br/><b>Getting there:\u00a0</b></p> <p>Opower is conveniently located at 1515 N Courthouse Rd, Arlington, VA 22201 - one block away from the Courthouse metro stop\u00a0(on the orange and silver line).\u00a0</p> <p>\n\n\n<b>Refund Policy:\u00a0</b></p> <p>Your payment guarantees your seat in the course. If something changes after registration and you cannot attend the course, your seat is yours to sell or give to someone else - just please let us know who! \u00a0As a rule we don't offer refunds or credits; \u00a0Instead your class fee will go toward our chapter fund which we will use to establish a scholarship fund going forward. \u00a0 That said, please do reach out and let us know if you have extenuating circumstances.</p>", 
