            "created": 1443061952000, 
            "description": "<p><b>Reminder: Registration is through <a href=\"http://wcm-contentfirst.eventbrite.com\">Eventbrite</a></b></p> <p>Join us as we learn about Capital One's pioneering Content-First Approach to building products, tools and websites.\u00a0</p> <p><b>Content-First Approach at\u00a0Capital One</b></p> <p>Content-First begins by\u00a0designing a conversation FIRST before any User Experience or creative is even considered.\u00a0</p> <p><br/><i><b>Bottom-line:\u00a0</b></i></p> <p>Users are HUMAN, so naturally we should speak their language.\u00a0</p> <p><i><b>Overview:\u00a0</b></i></p> <p>At Capital One, we design conversations with customers and prospects using natural language that's contextually relevant and use-case specific - wherever and however our audience connects with us.\u00a0</p> <p><i><b>The Process:\u00a0</b></i></p> <p>With the Content-First Approach, we begin with creating the conversation for a product, working with designers, product managers and other stakeholders who 'own' the project. This happens literally in a Word or Google Doc. That's the 'platform' for content design. Lo-fi, inexpensive and quick testing that mitigates rounds and rounds of UX testing.\u00a0</p> <p>We then conduct content testing with customers and prospects using a variety of methods and tools, which I think the group would find interesting and helpful. The objective? To see what WORDS resonate (and fail) BEFORE UX begins.\u00a0</p> <p>All this happens before we pass anything off to designers and in concert with\u00a0presentations and workshop with designers, product owners and others across the organization to ensure they understand the Content-First approach, and can incorporate humanity into everything they do.\u00a0</p> <p><b>SPEAKERS</b></p> <p><b>Sarah Goelitz<br/></b>UX Content Strategist, Capital One</p> <p><b>Michaela Hackner\u00a0</b><br/>Senior Manager UX Content Strategy, Capital One</p> <p><b>Cory Jurentkuff\u00a0<br/></b>Manager, Content Strategy, Digital Innovation &amp; Design\u00a0<br/>Capital One</p> <p>==================================</p> <p><b><i>Our Sustaining Sponsor</i></b></p> <p><img src=\"https://cdn.evbuc.com/eventlogos/138911562/sitecorelogo4meetup.jpg\" /></p> <p><a href=\"http://www.sitecore.com/\">Sitecore</a>\u00a0is the global leader in customer experience management software that lets marketers own the experience of every customer or prospect that engages with their brand. The company delivers highly relevant content and personalized digital experiences that delight audiences, build loyalty and drive revenue.\u00a0</p> <p>More than 3,500 of the world\u2019s leading brands and organizations trust Sitecore to help them deliver the meaningful interactions that win customers for life. Learn more at\u00a0<a href=\"http://www.sitecore.com/\">www.sitecore.com</a>\u00a0</p>", 
